import React from 'react';
import logo from './mlogo.png';
import * as Styled from './styled';

function App() {
  return (
    <div>
      <Styled.Header>
        <Styled.Logo src={logo} alt="Marvel logo" />
        <form>
          <label>Marvel Encyclopedia</label>
          <input type="text" id="search" required></input>
        </form>
      </Styled.Header>
    </div>
  );
}

export default App;
